import React from "react";

const Info = () => {
  return (
    <div className="info">
      <div className="ceremony">
        <div className="info-image"></div>
        <div className="info-content">
          <h2></h2>
          <h6></h6>
        </div>
        <div className="info button"></div>
      </div>
      <div className="party">
        <div className="info-image"></div>
        <div className="info-content"></div>
        <div className="info button"></div>
      </div>
      <div className="rsvp"></div>
    </div>
  );
};

export default Info;
